import React from 'react';

const ThemeColors = () => {
  const themeColors = [
    {
      id: 104,
      classTitle: 'primary',
      classColor: 'primary',
      classBg: 'bgPrimary',
    },
    {
      id: 104,
      classTitle: 'secondary',
      classColor: 'secondary',
      classBg: 'bgSecondary',
    },
    {
      id: 104,
      classTitle: 'tertiary',
      classColor: 'tertiary',
      classBg: 'bgTertiary',
    },
    {
      id: 104,
      classTitle: 'accent',
      classColor: 'accent',
      classBg: 'bgAccent',
    },
    {
      id: 105,
      classTitle: 'dark',
      classColor: 'dark',
      classBg: 'bgDark',
    },
    {
      id: 106,
      classTitle: 'success',
      classColor: 'success',
      classBg: 'bgSuccess',
    },
    {
      id: 107,
      classTitle: 'info',
      classColor: 'info',
      classBg: 'bgInfo',
    },
    {
      id: 108,
      classTitle: 'warning',
      classColor: 'warning',
      classBg: 'bgWarning',
    },
    {
      id: 109,
      classTitle: 'danger',
      classColor: 'danger',
      classBg: 'bgDanger',
    },
    {
      id: 110,
      classTitle: 'error',
      classColor: 'error',
      classBg: 'bgerror',
    },
  ];
  return (
    <>
      <div className='containerFluid1 container1-lg'>
        <div className='sectionTitle pb2'>
          <h5 className='fontStyled fsH5 primary'>Theme Colors</h5>
        </div>

        <div className='row pb1 fontStyled primary'>
          <div className='col6 col3-sm classTitle'>
            <h6 className='fsSM'>Classes Names</h6>
          </div>
          <div className='col6 col9-sm classValue'>
            <h6 className='fsSM displayNone displayBlock-sm'>Appearance</h6>
          </div>
        </div>

        {themeColors.map((tc) => (
          <div className='row alignCenter mb1'>
            <div className='col4 col4-xs col3-sm'>
              <p className={`fsSM fwBold ${tc.classColor}`}>
                .{tc.classTitle}:
              </p>
            </div>
            <div className='col4 col4-xs col4-sm'>
              <div className={`border p1 light textCenter ${tc.classBg}`}>
                light
              </div>
            </div>
            <div className='col4 col4-xs col4-sm'>
              <div className={`border p1 bgLight textCenter ${tc.classColor}`}>
                bgLight
              </div>
            </div>
          </div>
        ))}
      </div>
    </>
  );
};

export default ThemeColors;
